Adult Swim has been on a roll with music lately. If you recognize the name at all, most know Adult Swim from their late night spot on Cartoon Network, giving home to cult classic TV like Aqua Teen Hunger Force, Sealab 2021, and Tim &amp; Eric Awesome Show Great Job!, and also ridiculous parodies including Childrens Hospital and NTSF:SD:SUV. But last year, Adult Swim curated an excellent Singles Program, giving viewers a free compilation of 13 exclusive singles from some fantastic names on the indie scene, including Wye Oak, Wavves, Flying Lotus, the Field, Com Truise, Death Grips, and Liars. This month, Adult Swim gives us another fantastic collection of new tunes with Garage Swim, a blazing mix of up and coming garage rock acts from all corners of the genre.

